import { render } from "react-dom";
import React from "react";
import CreateEventPage from './CreateEventPage.js';
import EventVisibilitySettingsBtn from './components/EventVisibilitySettingsBtn.js';
import ImageSection from './components/ImageSection.js';
import EventName from './components/EventName.js';
import Location from './components/Location.js';
import Schedule from './components/Schedule.js';
import Description from './components/Description.js';
import './css/bootstrap.min.css';

export { EventVisibilitySettingsBtn,
      ImageSection,
      EventName,
      Location,
      Schedule,
      Description,}



render(<CreateEventPage />, document.querySelector("#root"));
